import React from 'react';
import { Link } from 'react-router-dom';
import { Button } from 'react-bootstrap';

const AnimalSidebar = () => {
  return (
    <div className="mb-3">
      <div className="list-group">
        <Button className="list-group-item list-group-item-action active" disabled>
          Animales
        </Button>
        <Button as={Link} to="#" className="list-group-item list-group-item-action">
          Perros en adopción
        </Button>
        <Button as={Link} to="#" className="list-group-item list-group-item-action">
          Gatos en adopción
        </Button>
        <Button as={Link} to="#" className="list-group-item list-group-item-action">
          Casos urgentes
        </Button>
        <Button as={Link} to="#" className="list-group-item list-group-item-action">
          Animales adoptados
        </Button>
      </div>
    </div>
  );
};

export default AnimalSidebar;
